post_text:
Padres K-4;
Para estar listos para nuestros estudiantes el miércoles, no tendremos conferencias de padres / maestros en WES el martes. Gracias por su paciencia y comprensión mientras nos preparamos para un gran año. Los padres de kindergarten deben planear asistir a la reunión mañana a las 8 o 10 y, si es posible, traer los útiles de su hijo en una bolsa etiquetada.
Gracias.

