post_text:
Parents K-4;
In order to be ready for our students on Wednesday, we will not be having parent/teacher conferences at WES on Tuesday. Thank you for your patience and understanding as we get ready for a great year. Kindergarten parents should please plan to attend the meeting tomorrow at 8 or 10, and if possible, bring your child’s supplies in a labeled bag.
Thank you.

